import React from 'react';
import './forms.scss'
import Input from './inputs/Input';
import { Formik, Form } from 'formik';


const Fofms = () => {
      return (
            <Formik>
                  <Form className='form'>
                        <Input />
                  </Form>
            </Formik>

      );
}

export default Fofms;
